                {
                    name: "fine",
                }, {
                    name: "happy",
                }, {
                    name: "energetic",
                }, {
                    name: "motivated",
                }
            ]
        }, {
            name: "food",
            color: 'red',
            cells: [
                {
                    name: "bread",
                }, {
                    name: "potatoes",
                }, {
                    name: "pasta",
                }, {
                    name: "rice",
                }
            ]
        }, {
            name: "liquids",
            color: 'pink',
            cells: [
                {
                    name: "water",
                }, {
                    name: "wine",
                }, {
                    name: "coffee",
                }
            ]
        }, {
            name: "suplements",
            color: 'purple',
            cells: [
                {
                    name: "omega-3",
                }, {
                    name: "zink",
                }, {
                    name: "iron",
