            ]
        }, {
            name: "workouts",
            color: 'indigo',
            cells: [
                {
                    name: "run",
                }, {
                    name: "bike",
                }, {
                    name: "swim",
                }
            ]
        }, {
            name: "body",
            color: 'blue',
            cells: [
                {
                    name: "headache",
                }, {
                    name: "acne",
                }, {
                    name: "tender breasts",
                }, {
                    name: "backpain",
                }
            ]
        }, {
            name: "menst. cycle",
            color: 'green',
            cells: [
                {
                    name: "menstruation",
                }, {
                    name: "weak bleeding",
                }, {
                    name: "medium bleeding",
                }, {
                    name: "heavy bleeding",
                }
            ]
        }, {
            name: "sleep",
            color: 'gray',
            cells: [
                {
                    name: "restless",
                }, {
                    name: "good",
                }, {
                    name: "great",
                }, {
                    name: "0-4h",
                }, {
                    name: "5-7h",
                }, {
                    name: "8-9h",
                }, {
                    name: "10-11h",
                }
            ]
        }]
    }

    return (
        <div className="mx-8 lg:mx-32">
            <Header name={"Marianna"}/>
            <div className="flex justify-between">
                {inputs.categories.map(cat => <Category name={cat.name} bg={cat.bg_color} cells={cat.cells}/>)}
            </div>

        </div>
    )
}

export default HomePage
